import React from 'react'

function Weather({weatherInfo = []}) {
    return (
        <div className='row'>
            {
                weatherInfo.map((item, index) => (
                    <div key={index} className="col">
                        <div>
                            <h5>{item.weather.icon}</h5>
                        </div>
                    </div>
                ))  
            }
            
        </div>
    )
}

export default Weather
